import React from "react";
import { BrowserRouter as Router, withRouter, NavLink } from 'react-router-dom';
import { Nav, NavItem, NavDropdown, Navbar } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Nav id="navigation" className="navbar navbar-inverse menu-background sht-navbar">
        <Navbar className="navbar-expand-xl">

        </Navbar>
      </Nav>
    )
  }
} 

export default withRouter(CommunicatorNavigation);
